        Field+Forest™ by Kaytee® is a premium rat food made with wholesome ingredients your pet can smell and taste. Each ingredient is carefully curated from nature’s fields and forests to support your rat’s healthy diet. The all-in-one pellet works to prevent selective feeding and ensure naturally good nutrition in every bite. Unlike other small animals, timothy hay is not nutritionally necessary for rats which is why it is not included in our recipe. Field+Forest™ is simply good food. It contains NO added molasses, NO fillers, and NO artificial preservatives.
        
        
